import { Layout } from 'antd';
import React, { Component } from 'react';
const { Header } = Layout;

export default class HeadLayout extends Component {
    render() {
        return (
            <Header style={{ background: '#fff', padding: 0, display: 'flex', height: 60, width: '100%', justifyContent: 'center', alignItems: 'center', position: 'absolute', top: 0, left: 0, backgroundColor: '#0077ff' }}>
                <div>123</div>
            </Header>
        );
    }
}
